import { useState } from "react";
import { Link } from "react-router-dom";
import { ArrowRightIcon, MenuIcon, XIcon } from "@heroicons/react/solid";

export default function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <header className="fixed top-0 left-0 w-full z-50 backdrop-blur-md bg-black/50 shadow-md">
      <div className="container mx-auto flex flex-wrap p-4 md:px-10 flex-col md:flex-row items-center justify-between">

        {/* Logo */}
        <Link
          to="/"
          className="text-white text-3xl font-semibold tracking-wide hover:text-purple-400 transition duration-300"
        >
          Annie Rome
        </Link>

        {/* Mobile Menu Button */}
        <button
          className="md:hidden text-purple-300 focus:outline-none"
          onClick={() => setIsOpen(!isOpen)}
        >
          {isOpen ? (
            <XIcon className="w-8 h-8" />
          ) : (
            <MenuIcon className="w-8 h-8" />
          )}
        </button>

        {/* Navbar Links */}
        <nav
          className={`md:flex md:items-center md:space-x-10 md:static absolute bg-black/80 md:bg-transparent top-full left-0 w-full md:w-auto transition-all duration-300 ease-in-out ${
            isOpen ? "block" : "hidden"
          }`}
        >
          <Link
            to="/projects"
            className="block md:inline-block py-2 px-4 text-purple-300 hover:text-purple-400 transition duration-300"
          >
            Projects
          </Link>
          <Link
            to="/resume"
            className="block md:inline-block py-2 px-4 text-purple-300 hover:text-purple-400 transition duration-300"
          >
            Resume
          </Link>
        </nav>

        {/* Contact Button */}
        <a
          href="#contact"
          className="hidden md:flex items-center bg-gradient-to-r from-purple-500 to-purple-700 text-white font-medium py-2 px-6 rounded-full hover:scale-105 transition duration-300 shadow-lg"
        >
          Contact Me
          <ArrowRightIcon className="w-5 h-5 ml-2" />
        </a>

      </div>
    </header>
  );
}
